import React, { useState } from "react";

function UndoPaste() {

    const [onUndo, setUndoMouse] = useState(false);
    const [onCopyPase, setCopyPasteMouse] = useState(false);

    function handleMouseOver(event) {

        let id = event.target.id;
        id == "undo" ? setUndoMouse(true) : setCopyPasteMouse(true);
    }

    function handleMouseLeave(event) {
        let id = event.target.id;
        id == "undo" ? setUndoMouse(false) : setCopyPasteMouse(false);
    }
    return <div>
        <div className="bottomObj" id="undo" onMouseOver={handleMouseOver}>
            <img src="images/undo_icon.png" />
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px" }} />
        </div>
        <div className="bottomObj" id="clipboard" id="copyPaste">
            <img src="images/clipboard.png" />
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px" }} />
        </div>
    </div>;
}

export default UndoPaste;
